import React, {useState} from "react";
import styled from "styled-components";

const DivLog  = styled.div`
    border      : 1px;
    padding     : 5px;
`;

const Log = (props) => {
    const [username, setUsername] = useState("");

    const catchLogin = (e) => {
        e.preventDefault()
    };

    const inputChange = (e) => {
        setUsername(e.value.target);
    };

    return (
        <DivLog className={"card container"}>
            <label>
                <small>Username :</small>
            </label>
            <input type={"text"} value={username} onChange={ inputChange }/>
            <input type={"submit"} onClick={ catchLogin }>Login</input>
        </DivLog>
    );
};

export default Log;
